import { useState } from "react";
import { Navigate } from "react-router-dom";
import { useUserContext } from "../../context/user";


function Home(params) {

    const utxt = useUserContext();
    if (!utxt) {
        return (
            <Navigate to='login'/>
        )
    }

    const [loading, setloading] = useState(false);

    const loadhomes = async () => {
        setloading(true);
        await fetch(params.url + "homes/").then(res => res.json()).then(res => {
            console.log(res);
        })
        setloading(false);
    }
    loadhomes();

    return ( !loading && <h1>Hello world</h1>);
}

export default Home;
